import axios from 'axios';

export const BASE_URL = 'http://localhost:3000/';

export const getTasks = () =>
	axios.get(BASE_URL + 'posts').then((data) => {
		console.log(data);
	}); ;
useEffect(() => {
	// get tasks from API
	axios.get(BASE_URL + 'posts').then((data) => {
		console.log(data);
	});
}, []);
